function App() {

  const expenses = [
    {
      id: 'e1',
      title: 'Subscription',
      amount: 294,
      date: new Date(2022, 3, 8)
    },
    {
      id: 'e2',
      title: 'Restaurant food',
      amount: 350,
      date: new Date(2022, 4, 28)
    },
    {
      id: 'e3',
      title: 'Study',
      amount: 475,
      date: new Date(2022, 5, 18)
    },
    {
      id: 'e4',
      title: 'Daily shopping',
      amount: 800,
      date: new Date(2022, 5, 9)
    }
  ]
  return (
    <div>
      <Expenses items={props.items} />
    </div>
  );
}

export default App;
